import React from "react";
import { useLocation, useNavigate } from "react-router-dom";

const recommendations = [
  {
    key: "Vitamin A Deficiency",
    title: "Vitamin A Deficiency",
    color: "bg-orange-50",
    suggestions: [
      "Eat carrots, spinach, sweet potatoes, and liver.",
      "Add more green leafy vegetables to your diet.",
      "Avoid excessive alcohol—it depletes Vitamin A.",
      "Include fortified dairy and egg yolks in meals.",
    ],
  },
  {
    key: "Vitamin B12 Deficiency",
    title: "Vitamin B12 Deficiency",
    color: "bg-purple-50",
    suggestions: [
      "Consume more fish, poultry, eggs, and milk.",
      "Consider B12 supplements if you're vegetarian.",
      "Avoid antacids—they interfere with absorption.",
      "Include fortified cereals and plant-based milk.",
    ],
  },
  {
    key: "Vitamin D Deficiency",
    title: "Vitamin D Deficiency",
    color: "bg-yellow-50",
    suggestions: [
      "Spend 15–20 mins in sunlight daily.",
      "Include oily fish like salmon and tuna.",
      "Consume fortified milk and orange juice.",
      "Take Vitamin D3 supplements if needed.",
    ],
  },
  {
    key: "Zinc Deficiency",
    title: "Zinc Deficiency",
    color: "bg-blue-50",
    suggestions: [
      "Eat shellfish, meat, beans, and nuts.",
      "Avoid excessive iron—it competes with zinc.",
      "Add dairy, whole grains, and pumpkin seeds.",
      "Limit alcohol intake—it hinders zinc absorption.",
    ],
  },
];

// Mapping possible variant strings to normalized keys
const normalizeMap = {
  "vitamin a": "Vitamin A Deficiency",
  "vitamin a deficiency": "Vitamin A Deficiency",
  "vitamin b12": "Vitamin B12 Deficiency",
  "vitamin b12 deficiency": "Vitamin B12 Deficiency",
  "vitamin d": "Vitamin D Deficiency",
  "vitamin d deficiency": "Vitamin D Deficiency",
  "zinc": "Zinc Deficiency",
  "zinc deficiency": "Zinc Deficiency",
};

const Recommendation = () => {
  const { state } = useLocation();
  const navigate = useNavigate();

  const rawDeficiency = state?.result || state?.deficiency || "";
  const deficiency = normalizeMap[rawDeficiency.toLowerCase().trim()] || rawDeficiency;

  const selected = recommendations.find(
    (rec) => rec.key.toLowerCase().trim() === deficiency.toLowerCase().trim()
  );

  return (
    <div className="min-h-screen px-4 py-10 bg-white text-gray-800">
      <h1 className="text-3xl font-bold text-blue-700 text-center mb-10">
        Health Recommendation
      </h1>

      {!selected ? (
        <div className="text-center text-red-500 text-lg">
          No recommendation available.{" "}
          <button
            onClick={() => navigate("/")}
            className="text-blue-600 underline ml-1"
          >
            Go back to Home
          </button>
        </div>
      ) : (
        <div className="max-w-3xl mx-auto">
          <div
            className={`rounded-xl shadow-md p-6 border ${selected.color}`}
          >
            <h2 className="text-xl font-semibold text-blue-800 mb-4">
              {selected.title}
            </h2>
            <ul className="list-disc pl-5 space-y-2 text-base">
              {selected.suggestions.map((tip, i) => (
                <li key={i}>{tip}</li>
              ))}
            </ul>
          </div>
        </div>
      )}
    </div>
  );
};

export default Recommendation;




